function handlemenutype(e) {
  $(".mrc").attr("nav-type", e);
}
$(document).ready(function () {
  $("#mrc").mrcmenu({
    themelayout: "vertical",
    verticalMenuplacement: "left",
    verticalMenulayout: "wide",
    MenuTrigger: "click",
    SubMenuTrigger: "click",
    activeMenuClass: "active",
    ThemeBackgroundPattern: "pattern4",
    HeaderBackground: "theme1",
    LHeaderBackground: "theme1",
    NavbarBackground: "theme1",
    ActiveItemBackground: "theme1",
    SubItemBackground: "theme2",
    ActiveItemStyle: "style0",
    ItemBorder: !0,
    ItemBorderStyle: "none",
    SubItemBorder: !0,
    DropDownIconStyle: "style1",
    menutype: "st6",
    freamtype: "theme1",
    layouttype: "light",
    FixedNavbarPosition: !0,
    FixedHeaderPosition: !0,
    collapseVerticalLeftHeader: !0,
    VerticalSubMenuItemIconStyle: "style1",
    VerticalNavigationView: "view1",
    verticalMenueffect: {
      desktop: "shrink",
      tablet: "overlay",
      phone: "overlay",
    },
    defaultVerticalMenu: {
      desktop: "expanded",
      tablet: "offcanvas",
      phone: "offcanvas",
    },
    onToggleVerticalMenu: {
      desktop: "offcanvas",
      tablet: "expanded",
      phone: "expanded",
    },
  }),
    (function () {
      $(".theme-color > a.fream-type").on("click", function () {
        var e = $(this).attr("fream-type");
        $(".mrc").attr("fream-type", e),
          $(".mrc-header").attr("header-theme", "themelight" + e),
          $(".mrc-navbar").attr("navbar-theme", "theme" + e),
          $(".navbar-logo").attr("logo-theme", "theme" + e);
      });
    })(),
    (function () {
      $(".theme-color > a.Layout-type").on("click", function () {
        var e = $(this).attr("layout-type");
        $(".mrc").attr("layout-type", e),
          "dark" == e &&
            ($(".mrc-header").attr("header-theme", "theme6"),
            $(".mrc-navbar").attr("navbar-theme", "theme1"),
            $(".navbar-logo").attr("logo-theme", "theme6"),
            $("body").addClass("dark")),
          "light" == e &&
            ($(".mrc-header").attr("header-theme", "theme1"),
            $(".mrc-navbar").attr("navbar-theme", "themelight1"),
            $(".navbar-logo").attr("logo-theme", "theme1"),
            $("body").removeClass("dark"));
      });
    })(),
    (function () {
      $(".theme-color > a.logo-theme").on("click", function () {
        var e = $(this).attr("logo-theme");
        $(".navbar-logo").attr("logo-theme", e);
      });
    })(),
    (function () {
      $(".theme-color > a.leftheader-theme").on("click", function () {
        var e = $(this).attr("lheader-theme");
        $(".mrc-navigatio-lavel").attr("menu-title-theme", e);
      });
    })(),
    (function () {
      $(".theme-color > a.header-theme").on("click", function () {
        var e = $(this).attr("header-theme");
        $(".mrc-header").attr("header-theme", e),
          $(".navbar-logo").attr("logo-theme", e);
      });
    })(),
    (function () {
      $(".theme-color > a.navbar-theme").on("click", function () {
        var e = $(this).attr("navbar-theme");
        $(".mrc-navbar").attr("navbar-theme", e);
      });
    })(),
    (function () {
      $(".theme-color > a.active-item-theme").on("click", function () {
        var e = $(this).attr("active-item-theme");
        $(".mrc-navbar").attr("active-item-theme", e);
      });
    })(),
    (function () {
      $(".theme-color > a.sub-item-theme").on("click", function () {
        var e = $(this).attr("sub-item-theme");
        $(".mrc-navbar").attr("sub-item-theme", e);
      });
    })(),
    (function () {
      $(".theme-color > a.themebg-pattern").on("click", function () {
        var e = $(this).attr("themebg-pattern");
        $("body").attr("themebg-pattern", e);
      });
    })(),
    (function () {
      $("#navigation-view")
        .val("view1")
        .on("change", function (e) {
          (e = $(this).val()), $(".mrc").attr("vnavigation-view", e);
        });
    })(),
    (function () {
      $("#theme-layout").change(function () {
        $(this).is(":checked")
          ? ($(".mrc").attr("vertical-layout", "box"),
            $("#bg-pattern-visiblity").removeClass("d-none"))
          : ($(".mrc").attr("vertical-layout", "wide"),
            $("#bg-pattern-visiblity").addClass("d-none"));
      });
    })(),
    (function () {
      $("#vertical-menu-effect")
        .val("shrink")
        .on("change", function (e) {
          (e = $(this).val()), $(".mrc").attr("vertical-effect", e);
        });
    })(),
    (function () {
      $("#vertical-navbar-placement")
        .val("left")
        .on("change", function (e) {
          (e = $(this).val()),
            $(".mrc").attr("vertical-placement", e),
            $(".mrc-navbar").attr("mrc-navbar-position", "absolute"),
            $(".mrc-header .mrc-left-header").attr(
              "mrc-lheader-position",
              "relative"
            );
        });
    })(),
    (function () {
      $("#vertical-activeitem-style")
        .val("style1")
        .on("change", function (e) {
          (e = $(this).val()), $(".mrc-navbar").attr("active-item-style", e);
        });
    })(),
    (function () {
      $("#vertical-item-border").change(function () {
        $(this).is(":checked")
          ? $(".mrc-navbar .mrc-item").attr("item-border", "false")
          : $(".mrc-navbar .mrc-item").attr("item-border", "true");
      });
    })(),
    (function () {
      $("#vertical-subitem-border").change(function () {
        $(this).is(":checked")
          ? $(".mrc-navbar .mrc-item").attr("subitem-border", "false")
          : $(".mrc-navbar .mrc-item").attr("subitem-border", "true");
      });
    })(),
    (function () {
      $("#vertical-border-style")
        .val("solid")
        .on("change", function (e) {
          (e = $(this).val()),
            $(".mrc-navbar .mrc-item").attr("item-border-style", e);
        });
    })(),
    (function () {
      $("#vertical-dropdown-icon")
        .val("style1")
        .on("change", function (e) {
          (e = $(this).val()),
            $(".mrc-navbar .mrc-hasmenu").attr("dropdown-icon", e);
        });
    })(),
    (function () {
      $("#vertical-subitem-icon")
        .val("style5")
        .on("change", function (e) {
          (e = $(this).val()),
            $(".mrc-navbar .mrc-hasmenu").attr("subitem-icon", e);
        });
    })(),
    (function () {
      $("#sidebar-position").change(function () {
        $(this).is(":checked")
          ? ($(".mrc-navbar").attr("mrc-navbar-position", "fixed"),
            $(".mrc-header .mrc-left-header").attr(
              "mrc-lheader-position",
              "fixed"
            ))
          : ($(".mrc-navbar").attr("mrc-navbar-position", "absolute"),
            $(".mrc-header .mrc-left-header").attr(
              "mrc-lheader-position",
              "relative"
            ));
      });
    })(),
    (function () {
      $("#header-position").change(function () {
        $(this).is(":checked")
          ? ($(".mrc-header").attr("mrc-header-position", "fixed"),
            $(".mrc-navbar").attr("mrc-header-position", "fixed"),
            $(".mrc-main-container").css(
              "margin-top",
              $(".mrc-header").outerHeight()
            ))
          : ($(".mrc-header").attr("mrc-header-position", "relative"),
            $(".mrc-navbar").attr("mrc-header-position", "relative"),
            $(".mrc-main-container").css("margin-top", "0px"));
      });
    })(),
    (function () {
      $("#collapse-left-header").change(function () {
        $(this).is(":checked")
          ? ($(".mrc-header, .mrc ").removeClass("iscollapsed"),
            $(".mrc-header, .mrc").addClass("nocollapsed"))
          : ($(".mrc-header, .mrc").addClass("iscollapsed"),
            $(".mrc-header, .mrc").removeClass("nocollapsed"));
      });
    })();
}),
  handlemenutype("st2");
